&lt;p style=&quot;text-align: center;&quot;&gt;&nbsp;Promoci&oacute;n &nbsp;juego CALL OF DUTY INFINTE WAREFARE&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;Valido hasta el 30 de septiembre 2017&lt;/p&gt;
&lt;p&gt;Call of Duty: Infinite Warfare presenta escenas alucinantes e incre&iacute;bles momentos cinem&aacute;ticos, enmarcados dentro de una apasionante representaci&oacute;n de la guerra que rememora las ra&iacute;ces de la franquicia.&lt;br&gt; &lt;br&gt; &lt;strong&gt;MULTIJUGADOR &Eacute;PICO&lt;/strong&gt;&lt;br&gt;Ha vuelto el sistema de movimiento encadenado que ya conoces y te encanta. Consigue m&aacute;s recompensas que nunca por utilizar el entorno y aplicar la estrategia en combate.&nbsp;&lt;br&gt; &lt;br&gt; &lt;strong&gt;EMOCI&Oacute;N ZOMBI&lt;/strong&gt;&lt;br&gt;Una nueva e inmersiva historia de Zombis que te sumergir&aacute; en una inquietante aventura no apta para card&iacute;acos.&lt;br&gt; &lt;br&gt; &lt;strong&gt;TU MISI&Oacute;N&nbsp;&lt;/strong&gt;&lt;br&gt;Tras un devastador ataque a la Tierra, ser&aacute;s el capit&aacute;n Reyes, un piloto de operaciones especiales de nivel 1, y tendr&aacute;s que liderar lo que queda de las fuerzas de la coalici&oacute;n contra un enemigo implacable mientras sobrevives a los extremos y mort&iacute;feros entornos espaciales.&lt;br&gt; &lt;br&gt; &lt;strong&gt;EL BIEN CONTRA EL MAL&nbsp;&lt;/strong&gt;&lt;br&gt;Tras un ataque sorpresa al cuartel general de la UNSA, el teniente Nick Reyes deber&aacute; ponerse al mando de la Retribution, una de las &uacute;ltimas naves de guerra de la Tierra. En un momento de m&aacute;xima adversidad, tendr&aacute;s que liderar lo que queda de las fuerzas de la coalici&oacute;n contra el implacable Frente de Defensa Colonial.&lt;br&gt; &lt;br&gt; &lt;strong&gt;EL BIEN CONTRA EL MAL&nbsp;&lt;/strong&gt;&lt;br&gt;Tras un ataque sorpresa al cuartel general de la UNSA, el teniente Nick Reyes deber&aacute; ponerse al mando de la Retribution, una de las &uacute;ltimas naves de guerra de la Tierra. En un momento de m&aacute;xima adversidad, tendr&aacute;s que liderar lo que queda de las fuerzas de la coalici&oacute;n contra el implacable Frente de Defensa Colonial.&lt;br&gt; &lt;br&gt; &lt;strong&gt;LA UNSA Y LA SATO&nbsp;&lt;/strong&gt;&lt;br&gt;A medida que se extendi&oacute; la colonizaci&oacute;n espacial, las naciones del mundo formaron la Alianza Espacial de las Naciones Unidas (UNSA, por sus siglas en ingl&eacute;s) para controlar los viajes y el comercio. La Organizaci&oacute;n del Tratado Solar Asociado (SATO, por sus siglas en ingl&eacute;s) es el cuerpo de la UNSA encargado de mantener la paz.&lt;br&gt; &lt;br&gt; &lt;strong&gt;UN ENEMIGO FAN&Aacute;TICO&lt;/strong&gt;&lt;br&gt;El Frente de Defensa Colonial (el Frente o el SDF), integrado por un grupo de disidentes que se escindi&oacute; hace a&ntilde;os de la UNSA durante las Guerras de Secesi&oacute;n, es una potencia fascista compuesta por brutales y violentos radicales endurecidos por las condiciones extremas de los entornos exteriores.&nbsp;&lt;br&gt; &lt;br&gt; &lt;strong&gt;ELENCO&nbsp;&lt;/strong&gt;&lt;br&gt;A lo largo del conflicto, Reyes se relacionar&aacute; con muchos soldados, tripulantes y otras unidades mientras dirige a sus tropas en el combate.&lt;br&gt; &lt;br&gt; &lt;strong&gt;SS RETRIBUTION&nbsp;&lt;/strong&gt;&lt;br&gt;La Retribution, casi un personaje en s&iacute; misma, es tu base y la principal nave de guerra a lo largo de tu viaje. Es un centro al que regresar&aacute;s una y otra vez. El sobrenombre de la Retribution es &quot;Punta de lanza&quot;, y se debe a su forma y a su participaci&oacute;n en las operaciones en primera l&iacute;nea.&lt;br&gt; &lt;br&gt; &lt;strong&gt;GUERRA ESPACIAL&nbsp;&lt;/strong&gt;&lt;br&gt;A lo largo de la campa&ntilde;a de la historia, tambi&eacute;n pilotar&aacute;s tu propio caza de combate, m&aacute;s conocido como Jackal. Presente en las misiones de la historia, el Jackal se puede personalizar y evolucionar&aacute; a medida que progreses en el juego.&lt;br&gt; &lt;br&gt; &lt;strong&gt;NUEVAS ARMAS&nbsp;&lt;/strong&gt;&lt;br&gt;El potente armamento de Infinite Warfare incluye armas bal&iacute;sticas cl&aacute;sicas, nuevas armas de energ&iacute;a y equipo letal, as&iacute; como numerosas funcionalidades que te permitir&aacute;n transformar tu arma en mitad del combate.&lt;/p&gt;
